import s from "./Home.module.css";
const Home = (props) => {
 
  
 return(  
   
<div className = {s.homepagestyle}>
   s
   <h1>Welcome to  our bank</h1>
     <div className = {s.creditcard}>
     <div className = {s.creditnumber}>
     <label for="ccn">Credit Card Number:</label>
     <input type="text" pattern="[0-9]*" inputmode="numeric" placeholder="xxxx-xxxx-xxxx-xxxx"> </input>
   
     </div>  
     <div class="cvvinput">
     <label for="ccn">CVV:</label>
        <input type="text" placeholder="CVV"/>
      </div>
      <div class="cvv-details">
        <p>3 or 4 digits usually found <br/> on the signature strip</p>
      </div>
      </div>
    </div>
);


}
export default Home;
